import React from 'react';
import "./Fourth.css";

const Fourth = () => {
  return (
    <div className='container fourth'>
        <div className='row'>
            <div className='col-md-7'>
                <div>
                    <h1>Most preferred assisted living facility @ <br/>Bangalore</h1><br/><br/>
                    <p>India's Largest Assisted Living Facility is now in Bangalore. The team of Athulya Assisted living is overwhelmed and happy to announce that, we are next extending our new branch in Bangalore with more advanced facilities and a new outlook. Also, our facility at Bangalore will be the largest of all the Assisted living facilities in Athulya. Being located near super-specialty hospitals, Bangalore is the best senior living hub that provides premium infrastructure, a safe environment, and technology-enabled care for your elderly to have happy and graceful aging. On a whole, Athulya Assisted Living in Bangalore offers world-class care for your senior to enjoy the patterns of a holistic living experience.<br/><br/>

Senior's most preferred assisted living facility is now in Bangalore within the reach of city limits making the elder's wish come true to live a peaceful life with round-the-clock clinical care, facilities, and amenities seniors need.</p>
                </div>

            </div>
            <div className='col-md-5'>

            </div>
        </div>
    </div>
  )
}

export default Fourth
